import React from 'react';
import { Container, Typography, Paper } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles((theme) => ({
    paper: {
        padding: theme.spacing(2),
        marginTop: theme.spacing(2),
    },
}));

const PatientInfo = ({ patientData }) => {
    const classes = useStyles();

    return (
        <Container maxWidth="sm">
            <Paper className={classes.paper}>
                <Typography variant="h5" gutterBottom>
                    Patient Information
                </Typography>
                <Typography>Name: {patientData.nome_completo}</Typography>
                <Typography>Gender: {patientData.sexo}</Typography>
                <Typography>Email: {patientData.email}</Typography>
                <Typography>Phone: {patientData.celular}</Typography>
                {/* Add more patient information fields as needed */}
            </Paper>
        </Container>
    );
};

export default PatientInfo;
